import React from "react";
import Navbar from "./Navbar";
import Hero from "./Hero";
import Projects from "./Project";
import Contact from "./Contact";

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Projects />
      <Contact />
    </div>
  );
}

export default App;
